import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header style={{
      backgroundColor: '#fffefeff',
      color: 'white',
      padding: '15px 20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      flexWrap: 'wrap'
    }}>
      <Link to="/admin-login">
        <button style={{
          backgroundColor: '#FFA500',
          color: '#000',
          border: 'none',
          borderRadius: '5px',
          padding: '10px 15px',
          cursor: 'pointer',
          fontWeight: 'bold',
          boxShadow: '0 2px 5px rgba(0,0,0,0.3)'
        }}>
          Admin Login
        </button>
      </Link>
    </header>
  );

  return (
    <nav style={{
      backgroundColor: '#fff',
      padding: '10px 20px',   
      boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
    }}>
      <Link to="/" style={{ margin: '0 15px', textDecoration: 'none', color: '#333' }}>Home</Link>
      <Link to="/about" style={{ margin: '0 15px', textDecoration: 'none', color: '#333' }}>About</Link>
      <Link to="/order" style={{ margin: '0 15px', textDecoration: 'none', color: '#333' }}>Order</Link>
      <Link to="/admin" style={{ margin: '0 15px', textDecoration: 'none', color: '#333' }}>Admin</Link>
    </nav>
  ); 
}


export default Header;
